import React, { useEffect, useState } from 'react'
import Container from 'react-bootstrap/Container';
import styled from 'styled-components';
import Typography from '@mui/material/Typography';
import leftbg from "../assets/images/left-bg.png";
import Teammember from '../components/Teammember';



const Team = () => {
  const Teamwrapper = styled.div`
    position: relative;
    background-color: white;
    background-image: url(${leftbg});
    background-size: auto;
    background-repeat: no-repeat;
    background-position: top left;
  h3{
     color:${({theme})=>theme.colors.headeractive};
     font-family:inherit;
     margin-bottom:20px;
     margin-top:0px!important;
   }
   span{
        color:${({theme})=>theme.colors.text7};
        position: relative;
        font-size:14px;
  }

  .team_member{

  }
  `


  const [team, setTeam]= useState([]);

  useEffect(()=>{
    const fetchData = async () => {
      try {
        const response = await fetch('/data/users.json');
        const data = await response.json();
        setUsers(data.users);
      } catch (error) {
        console.error(error);
      }
    };
    fetchData();
  },[])
  
  console.log('team page');
  console.log(team);

  
  return (
    <Teamwrapper>
      <Container className='announcementwrapper common_margin'>
        <Typography variant="h3" className='mt-3'>Teams</Typography>
        <span>below are the Team members list</span>
        <section className='team_member'>
        {
          team.map((val,idx)=>{
            return (
              <Teammember 
                key={idx}
                {...val}
              />
            )
          })
        }
        
        </section>
      </Container>
    </Teamwrapper>
  )
}

export default Team
